import React, {Component} from 'react';
import Task from './tasks/TaskContainer';
// import Task2 from './tasks/Task2';
// import Task3 from './tasks/Task3';
// import Task4 from './tasks/Task4';
// import Task5 from './tasks/Task5';
// import Task6 from './tasks/Task6';

class Team1 extends Component {
    state = {
        stage: 1
    }

    componentDidMount(){
        console.log(this.props.history.location.hash)
        console.log(this.props.history.location.key)
        if (localStorage.getItem('team') === null) {
            localStorage.setItem('team', 'oblachnyi_atlas');
        }
        this.setState({
            stage: +this.props.history.location.hash.substring(1)
        })
    }

    changeStep = () => {
        console.log("change")
        this.props.history.push('oblachnyi_atlas#2')
    }

    render(){
        console.log(this.state)
        return (
            <div>
                <Task number={this.state.stage} change={this.changeStep.bind(this)}/>
            </div>
        )
    }
}

export default Team1;
